import Banner from "../Banner/Banner";
import "./Productions.css";
import VideoProductions from "../../VideoProductions/VideoProductions";
import { useState } from "react";

function Productions() {
  const [clickedVideoProductions, setclickedVideoProductions] = useState(false);
  const [clickedPhotoProductions, setclickedPhotoProductions] = useState(false);
  return (
    <>
      <Banner />
      <div className='container-buttons'>
        <button
          clicked={clickedVideoProductions}
          onChange={(e) => setCheckedCharacters(e.target.checked)}
          className='container-buttons-btn-gradient'>
          Videos
        </button>
        <button className='container-buttons-btn-gradient'>Phothos</button>
      </div>
      <div className='video-section-container'>
        <VideoProductions />
      </div>
    </>
  );
}

export default Productions;
